import React from 'react'

const Chat = ({setOpenChatTab}) => {
  return (
    <div 
      className="position-fixed top-0 h-100 text-white bg-dark " 
      style={{width:"400px",left:"0%"}}>

    <button 
      type="button" 
      onClick={() => setOpenChatTab(false)} 
      className="btn btn-light btn-block w-100 mt-5"
      >Close</button>

    <div className="w-80 mt-5 mx-30 p-2 border border-1 border-white rounded-3 "
        style={{ height: "70%" }}>
    Chats
    </div>
  </div>
  )
}

export default Chat;
